import React, { Component } from 'react';
import Images from './Images';

class List extends Component{
    render(){
        return(
            <ol>
                <Images/>
                <li>Nasi Padang</li>
                <li>Soto Lamongan</li>
                <li>Sate</li>                
            </ol>
        );
    }
}

export default List;
